import React, { createContext, useEffect } from "react";

export const AuthContext = createContext();

const AuthContextprovider = (props) => {
  const name = "ji";
  ///////////SignIn

  return (
    <AuthContext.Provider
      value={{
        name: name,
      }}
    >
      {props.children}
    </AuthContext.Provider>
  );
};

export default AuthContextprovider;
